import React from 'react';
import NavBar from "../components/NavBar";
import TopBar from "../components/TopBar";

function AllUsers() {
  return (
    <div>
        <div className="absolute top-40 right-8 w-3/4 h-auto bg-white p-2">
        <div class="flex items-center border-b border-b-2 border-blue-500 py-2">
                    <input class="appearance-none bg-transparent border-none w-full text-gray-700 mr-3 py-1 px-2 leading-tight focus:outline-none" type="text" placeholder="Search..."/>
                    <button class="flex-shrink-0 bg-blue-500 hover:bg-blue-700 border-blue-500 hover:border-blue-700 text-sm border-4 text-white py-1 px-2 rounded" type="button">
                        Search
                    </button>
                </div>
        </div>
      <TopBar />
      <NavBar />
    </div>
  )
}

export default AllUsers
